To find the inverse of $h(x)$, we first need to find $h(x)$. We have that $h(x)=f(g(x))$, so we plug in $g(x)$ into $f(x)$:
\begin{align*}
h(x)&=f(g(x))\\
&=7(g(x))+5\\
&=7(x-1)+5\\
&=7x-7+5\\
&=7x-2
\end{align*}Now we need to find the inverse of $h(x)$. To do this, we swap $x$ and $y$ and solve for $y$:
\begin{align*}
x&=7y-2\\
\Rightarrow\qquad x+2&=7y\\
\Rightarrow\qquad \frac{x+2}{7}&=y
\end{align*}So the inverse of $h(x)$ is $\boxed{\frac{x+2}{7}}$.

