\newcommand{\boxed}[1]{\boxed{#1}}
Let's say the price of one pound of feathers is $x$ and the price of one ounce of gold is $y$. 

We got two equations from the problem:
\begin{align*}
8x + 2y &= 932\\
14x + 3y &= 1402
\end{align*}

Now, we can solve these equations. Multiply the first equation by 3 and the second equation by 2 to make the coefficients of $y$ the same.
\begin{align*}
24x + 6y &= 2796\\
28x + 6y &= 2804
\end{align*}

Now subtract the first equation from the second equation.
\begin{align*}
(28x + 6y) - (24x + 6y) &= 2804 - 2796\\
4x &= 8\\
x &= 2
\end{align*}

Now that we know the price of one pound of feathers, we can find the price of one ounce of gold by substituting $x$ into one of the original equations.
\begin{align*}
8x + 2y &= 932\\
8(2) + 2y &= 932\\
16 + 2y &= 932\\
2y &= 916\\
y &= 458
\end{align*}

Now that we know the price of one pound of feathers and the price of one ounce of gold, we can find the cost of five pounds of feathers and five ounces of gold.
\begin{align*}
5x + 5y &= 5(2) + 5(458)\\
&= 10 + 2290\\
&= \boxed{2300}
\end{document}

