To find the eighth term of the sequence, we need to find the common ratio. To do that, we can divide the second term by the first term.

Common ratio = (25/3) / (125/9) = (25/3) * (9/125) = 3/5

Now that we have the common ratio, we can find the eighth term by multiplying the first term by the common ratio seven times.

Eighth term = (125/9) * (3/5)^7 = (125/9) * (2187/78125) = 2187/5625

\boxed{\frac{2187}{5625}}

