\begin{equation*}
\frac{4a+3b}{a-2b}=5
\end{equation*}
Multiply both sides by $(a-2b)$.
\begin{equation*}
4a+3b=5(a-2b)
\end{equation*}
Expand the right side.
\begin{equation*}
4a+3b=5a-10b
\end{equation*}
Add $10b$ to both sides.
\begin{equation*}
4a+13b=5a
\end{equation*}
Subtract $4a$ from both sides.
\begin{equation*}
13b=a
\end{equation*}
Now, we can plug this into the original equation.
\begin{equation*}
\frac{a+11b}{a-b}=\frac{13b+11b}{13b-b}
\end{equation*}
Simplify the numerator and denominator.
\begin{equation*}
\frac{24b}{12b}
\end{equation*}
Divide the numerator and denominator by 12.
\begin{equation*}
\frac{2}{1}
\end{equation*}
\begin{equation*}
\boxed{2}
\end{equation*}
