To find the probability that there are no real solutions to the equation $x(x+5) = -n$, we need to find the values of $n$ for which the equation has no real solutions.

The equation $x(x+5) = -n$ can be rewritten as $x^2 + 5x + n = 0$. This is a quadratic equation, and it has no real solutions if the discriminant is negative.

The discriminant of the quadratic equation $ax^2 + bx + c = 0$ is given by $b^2 - 4ac$. In this case, $a = 1$, $b = 5$, and $c = n$. So, the discriminant is $5^2 - 4(1)(n) = 25 - 4n$.

The discriminant is negative if $25 - 4n < 0$, which implies $n > \frac{25}{4}$. Since $n$ is an integer, this means $n \geq 7$.

There are 4 values of $n$ between 1 and 10 inclusive that satisfy this condition: $n = 7, 8, 9, 10$. Therefore, the probability that there are no real solutions to the equation is $\frac{4}{10} = \frac{2}{5}$.

\boxed{\frac{2}{5}}

