\begin{equation*}
\begin{array}{rcl}
2x^2 - 13x + k = 0 \\
\Rightarrow\qquad x &=& \frac{-(-13) \pm \sqrt{(-13)^2 - 4(2)(k)}}{2(2)} \\
&=& \frac{13 \pm \sqrt{169 - 8k}}{4}
\end{array}
\end{equation*}We want $\frac{13-\sqrt{131}}{4}$ to be a root, so we set $x$ equal to this and solve for $k$:
\begin{equation*}
\begin{array}{rcl}
\frac{13-\sqrt{131}}{4} &=& \frac{13 \pm \sqrt{169 - 8k}}{4} \\
\Rightarrow\qquad 13-\sqrt{131} &=& 13 \pm \sqrt{169 - 8k} \\
\Rightarrow\qquad -\sqrt{131} &=& \pm \sqrt{169 - 8k} \\
\Rightarrow\qquad 131 &=& 169 - 8k \\
\Rightarrow\qquad 8k &=& 169 - 131 \\
\Rightarrow\qquad 8k &=& 38 \\
\Rightarrow\qquad k &=& \frac{38}{8} \\
\Rightarrow\qquad k &=& \boxed{\frac{19}{4}}
\end{array}
\end{equation*}
\end{document}

