Since the parabola contains the points $(-1,0)$, $(0,5)$, and $(5,0)$, we can plug these points into the equation $ax^2+bx+c$ to get the following system of equations:

\begin{align*}
a-b+c&=0,\\
c&=5,\\
25a+5b+c&=0.
\end{align*}Substituting $c=5$ into the first equation, we get $a-b+5=0$, or $a-b=-5$.  Substituting $c=5$ into the third equation, we get $25a+5b+5=0$, or $5a+b=-1$.  We can solve this system of equations by multiplying the first equation by 5 and adding it to the second equation:

\begin{align*}
5a-5b&=-25,\\
5a+b&=-1,\\
\hline
10a&=-26.
\end{align*}Dividing both sides by 10, we get $a=-\frac{13}{5}$.  Plugging this into the equation $a-b=-5$, we get $-\frac{13}{5}-b=-5$, or $b=\frac{12}{5}$.  Therefore, $100a+10b+c=100\left(-\frac{13}{5}\right)+10\left(\frac{12}{5}\right)+5=\boxed{-120+24+5=-91}$.

\end{document}

\boxed{-91}

