Let's say the two consecutive even numbers are x and x+2. 

Now, we square them: x^2 and (x+2)^2.

The difference of the squares is 60, so we set up the equation: (x+2)^2 - x^2 = 60.

Expanding the equation, we get: x^2 + 4x + 4 - x^2 = 60.

Simplifying the equation, we get: 4x + 4 = 60.

Subtracting 4 from both sides, we get: 4x = 56.

Dividing both sides by 4, we get: x = 14.

So, the two numbers are 14 and 16.

The sum of the two numbers is 14 + 16 = 30.

\boxed{30}

