The parabola $y = ax^2 + bx + c$ has vertex $(p,p)$ and $y$-intercept $(0,-p)$, where $p \neq 0$. 

The vertex form of a parabola is $y = a(x-h)^2 + k$, where $(h,k)$ is the vertex. Since the vertex is $(p,p)$, we have $y = a(x-p)^2 + p$.

The $y$-intercept is $(0,-p)$, so we have $-p = a(0-p)^2 + p$. Simplifying this, we get $-p = ap^2 + p$, so $ap^2 = -2p$.

Since $p \neq 0$, we can divide by $p$ to get $ap = -2$. 

Now, we expand the vertex form of the parabola: $y = a(x-p)^2 + p = a(x^2 - 2px + p^2) + p = ax^2 - 2apx + ap^2 + p$. 

Comparing this to the original equation $y = ax^2 + bx + c$, we see that $b = -2ap$. 

Since $ap = -2$, we have $b = -2(-2) = 4$.

\begin{equation*}
\boxed{4}
