Rearranging the equation gives
\begin{equation*}
\sqrt{x} = 120 - n^2
\end{equation*}
Squaring both sides again gives
\begin{equation*}
x = (120 - n^2)^2
\end{equation*}
Now, we need to find the values of n for which x is real. Since x is real, $(120 - n^2)^2$ must be non-negative. This is true for all real n.

However, we also need $120 - n^2 \ge 0$, since the square root of a negative number is not real. This gives $n^2 \le 120$.

The largest integer value of n that satisfies this inequality is 10, since $11^2 = 121 > 120$. The smallest integer value of n that satisfies this inequality is -10, since $(-11)^2 = 121 > 120$.

Therefore, the possible values of n are -10, -9, ..., 0, ..., 9, 10. There are 21 possible values of n.

\boxed{21}

