To find the $x$-intercepts, we set $y=0$ and solve for $x$:
\begin{align*}
0&=\frac{(x-2)^2-9}{3}\\
\Rightarrow\qquad 0&=(x-2)^2-9\\
\Rightarrow\qquad 9&=(x-2)^2\\
\Rightarrow\qquad \pm 3&=x-2\\
\Rightarrow\qquad x&=2\pm 3
\end{align*}So the $x$-intercepts are at $x=5$ and $x=-1$.

To find the $y$-intercept, we set $x=0$ and solve for $y$:
\begin{align*}
y&=\frac{(0-2)^2-9}{3}\\
&=\frac{4-9}{3}\\
&=\frac{-5}{3}
\end{align*}So the $y$-intercept is at $y=-\frac{5}{3}$.

The polygon formed by the $x$- and $y$-intercepts is a triangle with base $5-(-1)=6$ and height $\frac{5}{3}$.  Therefore, the area of the polygon is
$$\frac{1}{2}\cdot 6\cdot \frac{5}{3}=\boxed{\frac{5}{1}}$$

