To find the area of the square, we need to find the length of its side. Since one of its sides coincides with the line $y = 7$, the $y$-coordinate of the endpoints of this side is 7.

Now, we need to find the $x$-coordinates of the endpoints of this side. Since the endpoints lie on the parabola $y = 2x^2 + 8x + 4$, we can substitute $y = 7$ into the equation of the parabola and solve for $x$:

\begin{align*}
7 &= 2x^2 + 8x + 4\\
0 &= 2x^2 + 8x - 3\\
0 &= (2x - 1)(x + 3)\\
x &= \frac{1}{2} \text{ or } x = -3
\end{align*}

So, the $x$-coordinates of the endpoints of the side are $\frac{1}{2}$ and $-3$. The length of the side is the difference between these two $x$-coordinates:

$$\text{Length of side} = \frac{1}{2} - (-3) = \frac{7}{2}$$

The area of the square is the square of the length of its side:

$$\text{Area of square} = \left(\frac{7}{2}\right)^2 = \frac{49}{4}$$

\boxed{\frac{49}{4}}

