\triangle + \triangle &= \diamond +\diamond + \diamond + \diamond + \diamond \tag{2} \\
\triangle + \triangle &= \clubsuit + \diamond \tag{3}
\end{align*}

From equation (2), we can write $\triangle + \triangle = 5\diamond$. Substituting this into equation (3), we get $5\diamond = \clubsuit + \diamond$. Rearranging, we have $4\diamond = \clubsuit$. Substituting this into equation (1), we get $\triangle + \square = 4\diamond$. 

Since $\triangle + \triangle = 5\diamond$, we can write $\triangle = \frac{5}{2}\diamond$. Substituting this into $\triangle + \square = 4\diamond$, we get $\frac{5}{2}\diamond + \square = 4\diamond$. Rearranging, we have $\square = 4\diamond - \frac{5}{2}\diamond = \frac{3}{2}\diamond$.

Since $\triangle$, $\square$, $\diamond$, $\clubsuit$ represent four different integers from 1 to 9, the only possible value of $\diamond$ is 2. Therefore, $\square = \frac{3}{2} \times 2 = 3$.

\boxed{3}

