Since the parabola has a vertical line of symmetry at $x=1$, we know that the vertex of the parabola is at $(1, y_0)$ for some $y_0$. The axis of symmetry of a parabola $y=ax^2+bx+c$ is given by $x=-\frac{b}{2a}$. Therefore, we have

$$1=-\frac{b}{2a}\Rightarrow b=-2a.$$The equation of the parabola becomes

$$y=ax^2-2ax+c.$$Since the parabola goes through the point $(-1,3)$, we have

$$3=a(-1)^2-2a(-1)+c\Rightarrow 3=a+2a+c\Rightarrow c=3-3a.$$The equation of the parabola becomes

$$y=ax^2-2ax+3-3a.$$Since the parabola goes through the point $(2,-2)$, we have

$$-2=a(2)^2-2a(2)+3-3a\Rightarrow -2=4a-4a+3-3a\Rightarrow -5=-3a\Rightarrow a=\frac{5}{3}.$$The equation of the parabola becomes

$$y=\frac{5}{3}x^2-\frac{10}{3}x+3-5=\frac{5}{3}x^2-\frac{10}{3}x-2.$$The quadratic has two real roots, so the discriminant is positive:

$$\left(-\frac{10}{3}\right)^2-4\left(\frac{5}{3}\right)(-2)>0\Rightarrow \frac{100}{9}+\frac{40}{3}>0\Rightarrow \frac{100+120}{9}>0\Rightarrow \frac{220}{9}>0,$$which is true. The roots of the quadratic are

$$x=\frac{-\left(-\frac{10}{3}\right)\pm\sqrt{\left(-\frac{10}{3}\right)^2-4\left(\frac{5}{3}\right)(-2)}}{2\left(\frac{5}{3}\right)}=\frac{\frac{10}{3}\pm\sqrt{\frac{100}{9}+\frac{40}{3}}}{\frac{10}{3}}=\frac{\frac{10}{3}\pm\frac{\sqrt{220}}{3}}{\frac{10}{3}}=\frac{10\pm\sqrt{220}}{10}=\frac{5\pm\sqrt{55}}{5}.$$The greater root is $\frac{5+\sqrt{55}}{5}=\frac{5}{5}+\frac{\sqrt{55}}{5}=1+\frac{\sqrt{55}}{5}=\frac{5+\sqrt{55}}{5}$. Therefore, $\sqrt{n}+1=\frac{5+\sqrt{55}}{5}$.

\begin{equation*}
