Let's say Amy has $a$ coins, Ben has $b$ coins, Carl has $c$ coins, and Debbie has $d$ coins.

We know that Ben has three times the number of coins that Amy has, so $b = 3a$.

We also know that Ben has a third of the number of coins that Carl has, so $b = \frac{1}{3}c$.

We can set these two equations equal to each other to get $3a = \frac{1}{3}c$, which means $c = 9a$.

We know that Debbie has two-thirds the number of coins that Carl has, so $d = \frac{2}{3}c$. Substituting $c = 9a$, we get $d = \frac{2}{3} \cdot 9a = 6a$.

We are given that the product of the number of coins that Amy, Ben, Carl, and Debbie have is $162$, so $a \cdot b \cdot c \cdot d = 162$. Substituting $b = 3a$, $c = 9a$, and $d = 6a$, we get $a \cdot 3a \cdot 9a \cdot 6a = 162$.

This simplifies to $162a^4 = 162$, which means $a^4 = 1$. Therefore, $a = 1$.

Now we can find the number of coins that each person has: $a = 1$, $b = 3a = 3$, $c = 9a = 9$, and $d = 6a = 6$.

The total number of coins is $a + b + c + d = 1 + 3 + 9 + 6 = 19$.

