\begin{align*}
5 &= 10-23t-10t^2 \\
0 &= 10-23t-10t^2 - 5 \\
0 &= 5-23t-10t^2 \\
0 &= -10t^2 - 23t + 5 \\
0 &= 10t^2 + 23t - 5 \\
\end{align*}

We can solve this quadratic equation using the quadratic formula:

$$t = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}$$

In this case, $a=10$, $b=23$, and $c=-5$. Plugging these values into the formula, we get:

\begin{align*}
t &= \frac{-23 \pm \sqrt{23^2 - 4(10)(-5)}}{2(10)} \\
