The midpoint between two points $A(a,b)$ and $B(c,d)$ is $M(m,n)=\left(\frac{a+c}{2},\frac{b+d}{2}\right)$. 

If $A$ is moved vertically upwards 20 units and horizontally to the right 14 units, then the new coordinates of $A$ are $(a+14, b+20)$. If $B$ is moved vertically downwards 4 units and horizontally to the left 2 units, then the new coordinates of $B$ are $(c-2, d-4)$. 

The new midpoint between $A$ and $B$ is $M'=\left(\frac{(a+14)+(c-2)}{2},\frac{(b+20)+(d-4)}{2}\right)=\left(\frac{a+c}{2}+6,\frac{b+d}{2}+8\right)=(m+6,n+8)$.

The distance between $M$ and $M'$ is 
\begin{align*}
\sqrt{(m+6-m)^2+(n+8-n)^2}&=\sqrt{6^2+8^2}\\
&=\sqrt{36+64}\\
&=\sqrt{100}\\
&=\boxed{10}.
\end{align*}

\end{document}

