Now we can substitute $x = \frac{17}{8}$ into $x + y = 4.$ Then we got $\frac{17}{8} + y = 4.$ 

Now we can subtract $\frac{17}{8}$ from $\frac{17}{8} + y = 4.$ Then we got $y = 4 - \frac{17}{8}.$ 

