$g(x) = x^3 + 5x^2 + 9x - 2$

$f(g(x)) = (x^3 + 5x^2 + 9x - 2)^3 - 6(x^3 + 5x^2 + 9x - 2)^2 + 3(x^3 + 5x^2 + 9x - 2) - 4$

Now, we need to find the constant term. To do that, we need to find the terms that don't have any $x$ in them.

