To find the circumference of the circle, we need to find the radius first. To do that, we need to rewrite the equation of the circle in standard form.

The equation of the circle is $x^2+6x +y^2-12y-4=0$. We can rewrite it by completing the square.

\begin{align*}
x^2+6x +y^2-12y-4&=0\\
x^2+6x +9 +y^2-12y+36&=4+9+36\\
(x+3)^2 +(y-6)^2&=49
\end{align*}

Now we can see that the radius of the circle is $\sqrt{49}=7$.

The circumference of the circle is $2\pi r$, so the circumference is $2\pi \cdot 7 = 14\pi$.

\boxed{14\pi}

