To find the product of the $y$-coordinates of all the distinct solutions $(x,y)$ for the two equations $y=x^2-8$ and $y^2=-5x+44$, we need to solve the system of equations.

First, we can substitute $y=x^2-8$ into $y^2=-5x+44$ to get:

\begin{align*}
(x^2-8)^2 &= -5x+44 \\
x^4-16x^2+64 &= -5x+44 \\
x^4-16x^2+5x+20 &= 0
\end{align*}

This is a quartic equation, which can be factored as:

\begin{align*}
(x^2-4)(x^2-5x+5) &= 0
\end{align*}

Solving for $x$, we get:

\begin{align*}
x^2-4 &= 0 \Rightarrow x = \pm 2 \\
x^2-5x+5 &= 0 \Rightarrow x = \frac{5 \pm \sqrt{5}}{2}
\end{align*}

Now, we can substitute these values of $x$ into $y=x^2-8$ to get the corresponding values of $y$:

\begin{align*}
x = 2 &\Rightarrow y = 2^2-8 = -4 \\
x = -2 &\Rightarrow y = (-2)^2-8 = -4 \\
x = \frac{5 + \sqrt{5}}{2} &\Rightarrow y = \left(\frac{5 + \sqrt{5}}{2}\right)^2-8 = \frac{5 + \sqrt{5}}{2} \\
x = \frac{5 - \sqrt{5}}{2} &\Rightarrow y = \left(\frac{5 - \sqrt{5}}{2}\right)^2-8 = \frac{5 - \sqrt{5}}{2}
\end{align*}

The distinct solutions are $(2,-4)$, $(-2,-4)$, $\left(\frac{5 + \sqrt{5}}{2}, \frac{5 + \sqrt{5}}{2}\right)$, and $\left(\frac{5 - \sqrt{5}}{2}, \frac{5 - \sqrt{5}}{2}\right)$. The product of the $y$-coordinates is:

$$\boxed{-4 \cdot -4 \cdot \frac{5 + \sqrt{5}}{2} \cdot \frac{5 - \sqrt{5}}{2} = -4 \cdot -4 \cdot \frac{20}{4} = 80}$$

