To find the function $k(x)$ such that $f$ is its own inverse, we need to find a function that satisfies $f(f(x)) = x$.

We are given that 
\[f(x) =
\begin{cases}
k(x) &\text{if }x>2, \\
2+(x-2)^2&\text{if }x\leq2.
\end{cases}
\]

We can start by finding $f(f(x))$ for $x \leq 2$. We have
\begin{align*}
f(f(x)) &= f(2+(x-2)^2) \\
&= k(2+(x-2)^2) \quad \text{since } 2+(x-2)^2 > 2 \text{ for } x \leq 2.
\end{align*}

Since $f(f(x)) = x$, we have
\begin{align*}
k(2+(x-2)^2) &= x \\
\Rightarrow\qquad k(y) &= \pm \sqrt{y-2} + 2 \quad \text{for } y > 2.
\end{align*}

However, we also need to check the case when $x > 2$. We have
\begin{align*}
f(f(x)) &= f(k(x)) \\
&= 2 + (k(x) - 2)^2 \quad \text{since } k(x) \leq 2 \text{ for } x > 2.
\end{align*}

Since $f(f(x)) = x$, we have
\begin{align*}
2 + (k(x) - 2)^2 &= x \\
\Rightarrow\qquad (k(x) - 2)^2 &= x - 2 \\
\Rightarrow\qquad k(x) - 2 &= \pm \sqrt{x - 2} \\
\Rightarrow\qquad k(x) &= \pm \sqrt{x - 2} + 2.
\end{align*}

However, we also know that $k(x) \leq 2$ for $x > 2$. Therefore, we must have
\begin{align*}
k(x) &= -\sqrt{x - 2} + 2.
\end{align*}

\boxed{k(x) = -\sqrt{x - 2} + 2}

