$$15(2a)^4\frac{b^2}{9} = 15\cdot 16a^4\frac{b^2}{9} = \frac{240}{9}a^4b^2$$

Therefore, the coefficient of $a^4b^2$ in the expansion of $\left(2a-\frac{b}{3}\right)^6$ is $\frac{240}{9} = \frac{80}{3}$.

