The volume of a pyramid is $\frac{1}{3}Bh$, where $B$ is the area of the base and $h$ is the height of the pyramid.

The base of the pyramid is a square with side length $AB$.  Since $PBD$ is an equilateral triangle with side length 6, $BD=6$.  Since $ABCD$ is a square, $AB=BD=6$.

The height of the pyramid is the altitude of $\triangle PBD$.  Since $\triangle PBD$ is equilateral, the altitude is $\frac{\sqrt{3}}{2}$ times the side length, so the height of the pyramid is $6\cdot\frac{\sqrt{3}}{2}=3\sqrt{3}$.

The area of the base is $AB^2=6^2=36$.  Therefore, the volume of the pyramid is $\frac{1}{3}Bh=\frac{1}{3}\cdot36\cdot3\sqrt{3}=\boxed{36\sqrt{3}}$.

