The original cube has 6 faces, each with an area of $3^2 = 9$ square inches. So the total surface area of the original cube is $6 \times 9 = 54$ square inches.

When a cube of side 1 inch is cut from each corner, it exposes 3 new faces of area $1^2 = 1$ square inch each. Since there are 8 corners, the total new surface area is $8 \times 3 \times 1 = 24$ square inches.

However, the surface area of the original cube is reduced by the area of the 8 small cubes cut from the corners. Each small cube has 3 faces of area $1^2 = 1$ square inch each that were originally part of the surface area of the large cube. So the total surface area of the large cube is reduced by $8 \times 3 \times 1 = 24$ square inches.

Now, when a cube of side 2 inches is inserted in each corner, it adds 3 new faces of area $2^2 = 4$ square inches each. Since there are 8 corners, the total new surface area is $8 \times 3 \times 4 = 96$ square inches.

However, the surface area of the large cube is reduced by the area of the 8 small cubes inserted in the corners. Each small cube has 3 faces of area $1^2 = 1$ square inch each that were originally part of the surface area of the large cube. So the total surface area of the large cube is reduced by $8 \times 3 \times 1 = 24$ square inches.

The total surface area of the resulting solid is $54 - 24 + 24 + 96 - 24 = \boxed{126}$ square inches.

