By the Angle Bisector Theorem, we have that $\frac{BD}{DC} = \frac{AB}{AC} = \frac{5}{4}.$  Let $BD = 5x$ and $DC = 4x.$  Then $BC = BD + DC = 5x + 4x = 9x = 5,$ so $x = \frac{5}{9}.$  Then $BD = \frac{25}{9}$ and $DC = \frac{20}{9}.$  By Stewart's Theorem, we have that

\begin{align*}
AD^2 &= \frac{AB^2 \cdot DC + AC^2 \cdot BD - BD \cdot DC \cdot BC}{BC}\\
&= \frac{5^2 \cdot \frac{20}{9} + 4^2 \cdot \frac{25}{9} - \frac{25}{9} \cdot \frac{20}{9} \cdot 5}{5}\\
&= \frac{100 + \frac{400}{9} - \frac{2500}{81}}{5}\\
&= \frac{900 + 400 - 2500/9}{45}\\
&= \frac{1300}{45} - \frac{2500}{405}\\
&= \frac{1300 \cdot 9}{45 \cdot 9} - \frac{2500}{405}\\
&= \frac{11700 - 2500}{405}\\
&= \boxed{\frac{9200}{405}}.
\end{align*}

