To find the area of quadrilateral $ABCD$, we can split it into two triangles, $\triangle ABC$ and $\triangle ACD$. 

The area of a triangle with coordinates $(x_1, y_1)$, $(x_2, y_2)$, and $(x_3, y_3)$ is given by the formula $\frac{1}{2} |x_1(y_2 - y_3) + x_2(y_3 - y_1) + x_3(y_1 - y_2)|$.

For $\triangle ABC$, the coordinates are $A(3,2)$, $B(3,-2)$, and $C(-3,-2)$. Using the formula, we get:

$\frac{1}{2} |3(-2 - (-2)) + 3((-2) - 2) + (-3)(2 - (-2))|$
$= \frac{1}{2} |0 - 12 - 12|$
$= \frac{1}{2} |-24|$
$= 12$

For $\triangle ACD$, the coordinates are $A(3,2)$, $C(-3,-2)$, and $D(-3,0)$. Using the formula, we get:

$\frac{1}{2} |3(-2 - 0) + (-3)(0 - 2) + (-3)(2 - (-2))|$
$= \frac{1}{2} |-6 + 6 - 12|$
$= \frac{1}{2} |-12|$
$= 6$

The area of quadrilateral $ABCD$ is the sum of the areas of $\triangle ABC$ and $\triangle ACD$.

$12 + 6 = 18$

