To find the sum of the roots, we first need to get a common denominator on the left-hand side of the equation.

\begin{align*}
\frac{1}{x-1} + \frac{1}{x-5} + \frac{1}{x-10} + \frac{1}{x-25} &= 2 \\
\frac{(x-5)(x-10)(x-25)+(x-1)(x-10)(x-25)+(x-1)(x-5)(x-25)+(x-1)(x-5)(x-10)}{(x-1)(x-5)(x-10)(x-25)} &= 2
\end{align*}

Now, we can multiply both sides by the denominator to get rid of the fractions.

\begin{align*}
(x-5)(x-10)(x-25)+(x-1)(x-10)(x-25)+(x-1)(x-5)(x-25)+(x-1)(x-5)(x-10) &= 2(x-1)(x-5)(x-10)(x-25)
\end{align*}

Expanding the left-hand side gives us a quartic equation.

\begin{align*}
(x^3-40x^2+395x-250)+(x^3-36x^2+335x-250)+(x^3-31x^2+275x-125)+(x^3-16x^2+155x-50) &= 2(x^4-41x^3+426x^2-1700x+1250) \\
4x^3-123x^2+1160x-675 &= 2x^4-82x^3+852x^2-3400x+2500
\end{align*}

Now, we can move everything to one side of the equation.

\begin{align*}
2x^4-86x^3+975x^2-3560x+3175 &= 0
\end{align*}

We can use Vieta's formulas to find the sum of the roots. The sum of the roots is equal to the negation of the coefficient of the cubic term divided by the coefficient of the quartic term.

\begin{align*}
\text{sum of roots} &= -\frac{-86}{2} \\
&= \boxed{43}
\end{document}

