We have that \begin{align*}
i + 2i^2 + 3i^3 + \cdots + ni^n &= 48 + 49i\\
\Rightarrow\qquad i - 2 - 3i + 4 + 5i - 6 - 7i + \cdots + ni^n &= 48 + 49i\\
\Rightarrow\qquad (i - 2 - 3i + 4 + 5i - 6 - 7i + \cdots) + ni^n &= 48 + 49i\\
\Rightarrow\qquad (1 - 2 + 4 - 6 + \cdots) + (i - 3i + 5i - 7i + \cdots) + ni^n &= 48 + 49i\\
\Rightarrow\qquad (1 - 2 + 4 - 6 + \cdots) + i(1 - 3 + 5 - 7 + \cdots) + ni^n &= 48 + 49i\\
\end{align*}Note that the sum of the first $n$ odd numbers is $n^2$, so the sum of the first $n$ even numbers is $n(n+1)$.  Therefore, the sum of the first $n$ even numbers with alternating signs is $-n$ if $n$ is even and $n+1$ if $n$ is odd.  Also, the sum of the first $n$ odd numbers with alternating signs is $-n$ if $n$ is odd and $n+1$ if $n$ is even.  Therefore, we have that \begin{align*}
(1 - 2 + 4 - 6 + \cdots) + i(1 - 3 + 5 - 7 + \cdots) + ni^n &= 48 + 49i\\
\Rightarrow\qquad (-n + ni) + ni^n &= 48 + 49i\\
\Rightarrow\qquad n(i + i^n) - n &= 48 + 49i\\
\Rightarrow\qquad n(i + i^n - 1) &= 48 + 49i\\
\end{align*}Note that $i + i^n - 1$ is equal to $i - 1$ if $n$ is even and $-1 + i$ if $n$ is odd.  Therefore, we have that \begin{align*}
n(i + i^n - 1) &= 48 + 49i\\
\Rightarrow\qquad n(i - 1) &= 48 + 49i\qquad\text{or}\qquad n(-1 + i) = 48 + 49i\\
\Rightarrow\qquad ni - n &= 48 + 49i\qquad\text{or}\qquad -n + ni = 48 + 49i\\
\Rightarrow\qquad n &= 49\qquad\text{or}\qquad n = 49\\
\end{align*}Therefore, the answer is $\boxed{49}$.

