Let the roots of $x^3 - Ax^2 + Bx - C = 0$ be $r,$ $s,$ and $t.$ Then we have
\begin{align*}
r + s + t &= A,\\
rs + st + tr &= B,\\
rst &= C.
\end{align*}Since the roots of $x^3 + Px^2 + Qx - 19 = 0$ are $r + 1,$ $s + 1,$ and $t + 1,$ we have
\begin{align*}
(r + 1) + (s + 1) + (t + 1) &= -P,\\
(r + 1)(s + 1) + (s + 1)(t + 1) + (t + 1)(r + 1) &= Q,\\
(r + 1)(s + 1)(t + 1) &= -19.
\end{align*}Expanding the last equation, we have
\begin{align*}
rst + (rs + st + tr) + (r + s + t) + 1 &= -19\\
\Rightarrow\qquad C + B + A + 1 &= -19\\
\Rightarrow\qquad A + B + C &= -20.
\end{align*}

\boxed{-20}

