We want to factor $x^4-nx+63$ into two nonconstant polynomials with integer coefficients.  We can write this as
\begin{align*}
x^4-nx+63 &=(x^2+ax+b)(x^2+cx+d)\\
&=x^4+(a+c)x^3+(ac+b+d)x^2+(ad+bc)x+bd.
\end{align*}Equating coefficients, we have
\begin{align*}
a+c&=0,\\
ac+b+d&=0,\\
ad+bc&=-n,\\
bd&=63.
\end{align*}From the first equation, we have $c=-a$.  Substituting this into the second equation, we have $-a^2+b+d=0$, so $d=a^2-b$.  Substituting this into the fourth equation, we have $b(a^2-b)=63$.  Since $63=7\cdot 3^2$, we have $b=7$ and $a^2-b=9$, so $a=\pm 4$ and $c=\mp 4$.  Substituting these into the third equation, we have $7(\pm 4)+(\mp 4)(9)=-n$, so $n=\boxed{11}$ or $n=\boxed{35}$.  Since we want the smallest such $n$, we have $n=\boxed{11}$.

\end{document}

\boxed{11}

