We know that if a polynomial with rational coefficients has an irrational root $a + \sqrt{b}$, it must also have the root $a - \sqrt{b}$. So, the polynomial $P(x)$ has roots $\sqrt{1+\sqrt{6}}$ and $\sqrt{1-\sqrt{6}}$ and also $-\sqrt{1+\sqrt{6}}$ and $-\sqrt{1-\sqrt{6}}$.

\begin{align*}
P(x) &= (x - \sqrt{1+\sqrt{6}})(x - \sqrt{1-\sqrt{6}})(x + \sqrt{1+\sqrt{6}})(x + \sqrt{1-\sqrt{6}})\\
&= ((x - \sqrt{1+\sqrt{6}})(x + \sqrt{1+\sqrt{6}})((x - \sqrt{1-\sqrt{6}})(x + \sqrt{1-\sqrt{6}})\\
&= (x^2 - (1 + \sqrt{6}))(x^2 - (1 - \sqrt{6}))\\
&= (x^2 - 1 - \sqrt{6})(x^2 - 1 + \sqrt{6})\\
&= (x^2 - 1)^2 - (\sqrt{6})^2\\
&= x^4 - 2x^2 + 1 - 6\\
&= x^4 - 2x^2 - 5
\end{align*}

\begin{align*}
P(1) &= 1^4 - 2(1)^2 - 5\\
&= 1 - 2 - 5\\
&= -6
\end{align*}

\boxed{-6}

