We are given two quadratic polynomials, $x^2 - ax + 24$ and $x^2 - bx + 36$. The problem asks us to find the number of ordered pairs $(a,b)$ of integers such that these two polynomials have one root in common.

\section*{Step 2: Find the roots of the first polynomial}
Let's denote the roots of the first polynomial as $r_1$ and $r_2$. Using Vieta's formulas, we know that $r_1 + r_2 = a$ and $r_1r_2 = 24$.

\section*{Step 3: Find the roots of the second polynomial}
Similarly, let's denote the roots of the second polynomial as $s_1$ and $s_2$. Using Vieta's formulas, we know that $s_1 + s_2 = b$ and $s_1s_2 = 36$.

\section*{Step 4: Analyze the common root condition}
Since the two polynomials have one root in common, we can assume without loss of generality that $r_1 = s_1$. This implies that $r_1r_2 = s_1s_2$, which means $24 = 36$. However, this is not possible, so we must have $r_1 \neq s_1$. Therefore, we can assume that $r_1 = s_2$.

\section*{Step 5: Find the possible values of $a$ and $b$}
Using the fact that $r_1r_2 = 24$ and $s_1s_2 = 36$, we can find the possible values of $a$ and $b$. Since $r_1 = s_2$, we have $r_1r_2 = s_2s_1$, which implies $24 = s_2s_1$. Therefore, we have $s_1 = \frac{24}{s_2}$. Substituting this into the equation $s_1 + s_2 = b$, we get $\frac{24}{s_2} + s_2 = b$.

\section*{Step 6: Find the possible values of $s_2$
Since $s_1s_2 = 36$, we know that $s_2$ must be a divisor of $36$. The possible values of $s_2$ are $\pm 1, \pm 2, \pm 3, \pm 4, \pm 6, \pm 9, \pm 12, \pm 18, \pm 36$.

\section*{Step 7: Find the corresponding values of $a$ and $b$
For each possible value of $s_2$, we can find the corresponding value of $s_1$ using the equation $s_1 = \frac{24}{s_2}$. Then, we can find the value of $b$ using the equation $b = s_1 + s_2$. Finally, we can find the value of $a$ using the equation $a = r_1 + r_2 = s_2 + \frac{24}{s_2}$.

\section*{Step 8: Count the number of ordered pairs $(a,b)$
After finding all the possible values of $a$ and $b$, we can count the number of ordered pairs $(a,b)$.

The final answer is: $\boxed{8}$

