\begin{align*}
z + |z| &= 2 + 8i \\
a + bi + \sqrt{a^2 + b^2} &= 2 + 8i
\end{align*}

Now we can say that $a + \sqrt{a^2 + b^2} = 2$ and $b = 8$.

Now we can plug $b = 8$ into $a + \sqrt{a^2 + b^2} = 2$.

\begin{align*}
a + \sqrt{a^2 + 8^2} &= 2 \\
