a^2 + 64 &= (2 - a)^2 \\
a^2 + 64 &= 4 - 4a + a^2 \\
64 &= 4 - 4a \\
60 &= -4a \\
-15 &= a
\end{align*}

Now we can plug $a = -15$ and $b = 8$ into $z = a + bi$.

