To find the area of the region that lies above the graph of $y = |x - 1| + |x - 3|$ but below the graph of $y = 8$, we need to find the intersection points of the two graphs.

The graph of $y = |x - 1| + |x - 3|$ is a V-shaped graph with its vertex at $(2, 0)$. The graph of $y = 8$ is a horizontal line.

The two graphs intersect when $|x - 1| + |x - 3| = 8$. We can solve this equation by considering two cases:

Case 1: $x \ge 3$
In this case, $|x - 1| + |x - 3| = x - 1 + x - 3 = 2x - 4$. So, we need to solve $2x - 4 = 8$, which gives $x = 6$.

Case 2: $x \le 1$
In this case, $|x - 1| + |x - 3| = -(x - 1) - (x - 3) = -2x + 4$. So, we need to solve $-2x + 4 = 8$, which gives $x = -2$.

The two graphs intersect at $x = -2$ and $x = 6$. The region that lies above the graph of $y = |x - 1| + |x - 3|$ but below the graph of $y = 8$ is a trapezoid with vertices at $(-2, 8)$, $(6, 8)$, $(2, 0)$, and $(-2, 0)$.

The area of the trapezoid is $\frac{1}{2} \times (8 + 0) \times (6 - (-2)) = \frac{1}{2} \times 8 \times 8 = 32$.

\begin{equation*}
\boxed{32}
