To find the product of all solutions to the equation $f(f(x)) = x$, we first need to find the expression for $f(f(x))$. 

We have that 
\begin{align*}
f(f(x)) &= f\left(\frac{2x+9}{x-7}\right)\\
&= \frac{2\left(\frac{2x+9}{x-7}\right)+9}{\left(\frac{2x+9}{x-7}\right)-7}\\
&= \frac{2(2x+9)+9(x-7)}{(2x+9)-7(x-7)}\\
&= \frac{4x+18+9x-63}{2x+9-7x+49}\\
&= \frac{13x-45}{-5x+58}.
\end{align*}

Now, we need to solve the equation $f(f(x)) = x$. We have that 
\begin{align*}
\frac{13x-45}{-5x+58} &= x\\
\Rightarrow\qquad 13x-45 &= x(-5x+58)\\
\Rightarrow\qquad 13x-45 &= -5x^2+58x\\
\Rightarrow\qquad 0 &= -5x^2+45x-45\\
\Rightarrow\qquad 0 &= -5(x^2-9x+9)\\
\Rightarrow\qquad 0 &= -5(x-3)^2.
\end{align*}

Therefore, the only solution to the equation $f(f(x)) = x$ is $x=3$. Hence, the product of all solutions is $\boxed{3}$.

