\begin{align*}
x^2-6x+8 &= (x-4)(x-2)\\
x^2+x-6 &= (x+3)(x-2)
\end{align*}

Now, we can rewrite the denominator as:

$$|(x-4)(x-2)|+|(x+3)(x-2)|$$

For this expression to be equal to zero, both terms inside the absolute value signs must be equal to zero. This means that:

$$(x-4)(x-2)=0 \quad \text{and} \quad (x+3)(x-2)=0$$

Solving these equations, we get:

$$x=2,4,-3$$

