Let the roots be $a, ar, ar^2, ar^3, ar^4$.  Then we have
\begin{align*}
a + ar + ar^2 + ar^3 + ar^4 &= 40\\
\Rightarrow\qquad a(1+r+r^2+r^3+r^4) &= 40.
\end{align*}The sum of the reciprocals of the roots is
\begin{align*}
\frac{1}{a} + \frac{1}{ar} + \frac{1}{ar^2} + \frac{1}{ar^3} + \frac{1}{ar^4} &= 10\\
\Rightarrow\qquad \frac{1+r+r^2+r^3+r^4}{ar^4} &= 10.
\end{align*}Dividing the first equation by the second, we have
\begin{align*}
a^2r^4 &= 4\\
\Rightarrow\qquad ar^2 &= \pm2.
\end{align*}The product of the roots is $a\cdot ar\cdot ar^2\cdot ar^3\cdot ar^4 = a^5r^{10} = S$.  Therefore, $S = (\pm2)^5 = \boxed{32}.$

