$a_{3} = 4(a_{2} + a_{1} + a_{0}) \mod 11 = 4(8 + 5 + 2) \mod 11 = 120 \mod 11 = 10$

$a_{4} = 4(a_{3} + a_{2} + a_{1}) \mod 11 = 4(10 + 8 + 5) \mod 11 = 184 \mod 11 = 7$

$a_{5} = 4(a_{4} + a_{3} + a_{2}) \mod 11 = 4(7 + 10 + 8) \mod 11 = 200 \mod 11 = 3$

