$a_{9} = 4(a_{8} + a_{7} + a_{6}) \mod 11 = 4(2 + 10 + 5) \mod 11 = 136 \mod 11 = 8$

We can see that the sequence is periodic with period 6, and the sequence is 2, 5, 8, 10, 7, 3.

