\begin{equation*}
\begin{aligned}
\text{We are given that } 1 \star 2 &= 3,\\
2 \star 3 &= 4,\\
\text{and } x \star d &= x.
\end{aligned}
\end{equation*}
\begin{equation*}
\begin{aligned}
\text{We are also given that } x \star y &= ax + by + cxy.\\
\text{Therefore, } 1 \star 2 &= a + 2b + 2c = 3,\\
2 \star 3 &= 2a + 3b + 6c = 4,\\
\text{and } x \star d &= ax + bd + cxd = x.
\end{aligned}
\end{equation*}
\begin{equation*}
\begin{aligned}
\text{We can solve the first two equations to get } a, b, \text{ and } c.\\
\text{Subtracting the first equation from the second equation, we get}\\
a + b + 4c &= 1.\\
\text{Subtracting the first equation from this equation, we get}\\
-b - 2c &= -2.\\
\text{Solving for } b, \text{ we get}\\
b &= -2 + 2c.\\
\text{Substituting this into the first equation, we get}\\
a + 2(-2 + 2c) + 2c &= 3.\\
\text{Simplifying, we get}\\
a + 6c &= 7.\\
\text{Substituting } b = -2 + 2c \text{ into the third equation, we get}\\
ax + (-2 + 2c)d + cxd &= x.\\
\text{Simplifying, we get}\\
ax + cxd &= x + 2d - 2cd.\\
\text{Factoring out } x, \text{ we get}\\
x(a + cd) &= x + 2d - 2cd.\\
\text{Since this is true for all } x, \text{ we have}\\
a + cd &= 1,\\
2d - 2cd &= 0.\\
\text{Solving for } d, \text{ we get}\\
d &= 0 \text{ or } d = \frac{1}{c}.\\
\text{However, we are given that } d \neq 0.\\
\text{Therefore, } d = \frac{1}{c}.\\
\text{Substituting this into the equation } a + cd = 1, \text{ we get}\\
a + \frac{1}{c} \cdot c &= 1.\\
\text{Simplifying, we get}\\
a + 1 &= 1.\\
\text{Solving for } a, \text{ we get}\\
a &= 0.\\
\text{Substituting this into the equation } a + 6c = 7, \text{ we get}\\
0 + 6c &= 7.\\
\text{Solving for } c, \text{ we get}\\
c &= \frac{7}{6}.\\
\text{Therefore, } d = \frac{1}{c} = \frac{1}{\frac{7}{6}} = \frac{6}{7}.\\
\end{aligned}
\end{equation*}
\begin{equation*}
\begin{aligned}
\text{Therefore, the value of } d \text{ is}\\
\boxed{\frac{6}{7}}.
\end{aligned}
\end{equation*}
