\begin{align*}
(x+y)^3 &= 10 + 3xy(x+y)\\
(x+y)(x+y)^2 &= 10 + 3xy(x+y)\\
(x+y)(7 + 2xy) &= 10 + 3xy(x+y)\\
7(x+y) + 2xy(x+y) &= 10 + 3xy(x+y)\\
7(x+y) + 2xy(x+y) - 3xy(x+y) &= 10\\
7(x+y) - xy(x+y) &= 10\\
