7(x+y) - xy(x+y) &= 10\\
7(x+y) - (x+y)^2 + 7 &= 10\\
7(x+y) - (x+y)^2 &= 3\\
-(x+y)^2 + 7(x+y) &= 3\\
-(x+y)^2 + 7(x+y) - 3 &= 0\\
\end{align*}

