To find the sum of the roots of $z^{12}=64$ that have a positive real part, we first need to find all the roots of the equation.

We can rewrite the equation as $z^{12} - 64 = 0$. This is a difference of squares, so we can factor it as $(z^6 - 8)(z^6 + 8) = 0$.

The roots of $z^6 - 8 = 0$ are the 6th roots of 8, which are $\sqrt[6]{8} = 2^{1/3}$ times the 6th roots of unity. The 6th roots of unity are $e^{2k\pi i/6}$ for $k = 0, 1, 2, 3, 4, 5$. So, the roots of $z^6 - 8 = 0$ are $2^{1/3}e^{2k\pi i/6}$ for $k = 0, 1, 2, 3, 4, 5$.

The roots of $z^6 + 8 = 0$ are the 6th roots of -8, which are $\sqrt[6]{-8} = 2^{1/3}e^{i\pi/6}$ times the 6th roots of unity. So, the roots of $z^6 + 8 = 0$ are $2^{1/3}e^{i\pi/6}e^{2k\pi i/6}$ for $k = 0, 1, 2, 3, 4, 5$.

Now, we need to find the roots that have a positive real part. The roots of $z^6 - 8 = 0$ that have a positive real part are $2^{1/3}e^{2k\pi i/6}$ for $k = 0, 1, 5$. The roots of $z^6 + 8 = 0$ that have a positive real part are $2^{1/3}e^{i\pi/6}e^{2k\pi i/6}$ for $k = 0, 1$.

The sum of the roots of $z^{12}=64$ that have a positive real part is:

\begin{align*}
&2^{1/3}e^{2\cdot 0\pi i/6} + 2^{1/3}e^{2\cdot 1\pi i/6} + 2^{1/3}e^{2\cdot 5\pi i/6} + 2^{1/3}e^{i\pi/6}e^{2\cdot 0\pi i/6} + 2^{1/3}e^{i\pi/6}e^{2\cdot 1\pi i/6}\\
&= 2^{1/3} + 2^{1/3}e^{i\pi/3} + 2^{1/3}e^{5i\pi/3} + 2^{1/3}e^{i\pi/6} + 2^{1/3}e^{i\pi/2}\\
&= 2^{1/3} + 2^{1/3}\left(\frac{1}{2} + i\frac{\sqrt{3}}{2}\right) + 2^{1/3}\left(\frac{1}{2} - i\frac{\sqrt{3}}{2}\right) + 2^{1/3}\left(\frac{\sqrt{3}}{2} + i\frac{1}{2}\right) + 2^{1/3}i\\
&= 2^{1/3} + 2^{1/3}\cdot\frac{1}{2} + 2^{1/3}\cdot\frac{1}{2} + 2^{1/3}\cdot\frac{\sqrt{3}}{2} + 2^{1/3}i\\
&= \boxed{4}
\end{align*}

