To find the reflection of the point $(11,16,22)$ across the plane $3x + 4y + 5z = 7,$ we need to find the foot of the perpendicular from the point to the plane, then travel the same distance past the plane to find the reflection.

First, we find the foot of the perpendicular. The normal vector of the plane is $\begin{pmatrix} 3 \\ 4 \\ 5 \end{pmatrix}.$ We parameterize the line passing through the point and perpendicular to the plane as

$$\begin{pmatrix} 11 \\ 16 \\ 22 \end{pmatrix} + t \begin{pmatrix} 3 \\ 4 \\ 5 \end{pmatrix}.$$We want to find $t$ such that this point lies on the plane:

\begin{align*}
3(11 + 3t) + 4(16 + 4t) + 5(22 + 5t) &= 7\\
\Rightarrow\qquad 33 + 9t + 64 + 16t + 110 + 25t &= 7\\
\Rightarrow\qquad 50t &= -200\\
\Rightarrow\qquad t &= -4.
\end{align*}So the foot of the perpendicular is at $\begin{pmatrix} 11 \\ 16 \\ 22 \end{pmatrix} - 4 \begin{pmatrix} 3 \\ 4 \\ 5 \end{pmatrix} = \begin{pmatrix} -1 \\ 0 \\ 2 \end{pmatrix}.$

Now we travel the same distance past the plane to find the reflection.  The reflection is at $\begin{pmatrix} -1 \\ 0 \\ 2 \end{pmatrix} - 4 \begin{pmatrix} 3 \\ 4 \\ 5 \end{pmatrix} = \boxed{\begin{pmatrix} -13 \\ -16 \\ -18 \end{pmatrix}}.$

