First, we need to translate the point to the origin by subtracting $-4 - 5i$. This gives us $3 - (-4 - 5i) = 7 + 5i$.

Next, we multiply by $i$ to get $i(7 + 5i) = -5 + 7i$.

Then, we take the complex conjugate to get $-5 - 7i$.

Finally, we translate the point back by adding $-4 - 5i$ to get $-5 - 7i - 4 - 5i = -9 - 12i$.

So, the resulting complex number is $\boxed{-9 - 12i}$.

