To convert from polar coordinates to rectangular coordinates, we use the formulas $x = r \cos \theta$ and $y = r \sin \theta$. 

Given the polar coordinates $\left( 10, \frac{\pi}{4} \right)$, we have $r = 10$ and $\theta = \frac{\pi}{4}$.

Now, we can plug these values into the formulas:

$x = 10 \cos \frac{\pi}{4} = 10 \cdot \frac{1}{\sqrt{2}} = \frac{10}{\sqrt{2}} = \frac{10 \sqrt{2}}{2} = 5 \sqrt{2}$

$y = 10 \sin \frac{\pi}{4} = 10 \cdot \frac{1}{\sqrt{2}} = \frac{10}{\sqrt{2}} = \frac{10 \sqrt{2}}{2} = 5 \sqrt{2}$

