Let's break this down step by step.

We have a regular heptagon $ABCDEFG$ with center $O$. The centroid of triangle $ABD$ is $M$. We want to find $\cos^2 \angle GOM$.

First, let's draw a diagram.

Since $ABCDEFG$ is a regular heptagon, all sides are equal. Let's call the side length $s$. Then, $OA = OB = OC = OD = OE = OF = OG = s$.

Since $M$ is the centroid of triangle $ABD$, we know that $M$ is the average of the coordinates of $A$, $B$, and $D$. Let's call the coordinates of $A$, $B$, and $D$ as $(x_A, y_A)$, $(x_B, y_B)$, and $(x_D, y_D)$ respectively. Then, the coordinates of $M$ are $\left(\frac{x_A + x_B + x_D}{3}, \frac{y_A + y_B + y_D}{3}\right)$.

Now, let's find the coordinates of $A$, $B$, and $D$. Since $ABCDEFG$ is a regular heptagon, we can use the fact that the internal angles of a regular polygon are equal. The internal angle of a regular heptagon is $\frac{900}{7}$ degrees.

Let's assume that the coordinates of $A$ are $(s, 0)$. Then, the coordinates of $B$ are $(s \cos \frac{900}{7}, s \sin \frac{900}{7})$. The coordinates of $D$ are $(s \cos \frac{1800}{7}, s \sin \frac{1800}{7})$.

Now, we can find the coordinates of $M$.

\begin{align*}
M &= \left(\frac{s + s \cos \frac{900}{7} + s \cos \frac{1800}{7}}{3}, \frac{s \sin \frac{900}{7} + s \sin \frac{1800}{7}}{3}\right)\\
&= \left(\frac{s (1 + \cos \frac{900}{7} + \cos \frac{1800}{7})}{3}, \frac{s (\sin \frac{900}{7} + \sin \frac{1800}{7})}{3}\right)
\end{align*}

Now, let's find $\cos \angle GOM$. We can use the dot product formula.

\begin{align*}
\cos \angle GOM &= \frac{\vec{OG} \cdot \vec{OM}}{|\vec{OG}| |\vec{OM}|}\\
&= \frac{(s, 0) \cdot \left(\frac{s (1 + \cos \frac{900}{7} + \cos \frac{1800}{7})}{3}, \frac{s (\sin \frac{900}{7} + \sin \frac{1800}{7})}{3}\right)}{s \sqrt{\left(\frac{s (1 + \cos \frac{900}{7} + \cos \frac{1800}{7})}{3}\right)^2 + \left(\frac{s (\sin \frac{900}{7} + \sin \frac{1800}{7})}{3}\right)^2}}\\
&= \frac{s \cdot \frac{s (1 + \cos \frac{900}{7} + \cos \frac{1800}{7})}{3}}{s \sqrt{\left(\frac{s (1 + \cos \frac{900}{7} + \cos \frac{1800}{7})}{3}\right)^2 + \left(\frac{s (\sin \frac{900}{7} + \sin \frac{1800}{7})}{3}\right)^2}}\\
&= \frac{1 + \cos \frac{900}{7} + \cos \frac{1800}{7}}{\sqrt{(1 + \cos \frac{900}{7} + \cos \frac{1800}{7})^2 + (\sin \frac{900}{7} + \sin \frac{1800}{7})^2}}\\
&= \frac{1 + \cos \frac{900}{7} + \cos \frac{1800}{7}}{\sqrt{3 + 2 \cos \frac{900}{7} + 2 \cos \frac{1800}{7} + 2 \cos \frac{900}{7} \cos \frac{1800}{7}}}
\end{align*}

Now, we can simplify this expression using the fact that $\cos \frac{1800}{7} = \cos \left(2 \cdot \frac{900}{7}\right) = 2 \cos^2 \frac{900}{7} - 1$.

\begin{align*}
\cos \angle GOM &= \frac{1 + \cos \frac{900}{7} + 2 \cos^2 \frac{900}{7} - 1}{\sqrt{3 + 2 \cos \frac{900}{7} + 2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} (2 \cos^2 \frac{900}{7} - 1)}}\\
&= \frac{2 \cos^2 \frac{900}{7} + \cos \frac{900}{7}}{\sqrt{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}}\\
&= \frac{\cos \frac{900}{7} (2 \cos \frac{900}{7} + 1)}{\sqrt{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}}
\end{align*}

Now, we can square this expression to get $\cos^2 \angle GOM$.

\begin{align*}
\cos^2 \angle GOM &= \left(\frac{\cos \frac{900}{7} (2 \cos \frac{900}{7} + 1)}{\sqrt{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}}\right)^2\\
&= \frac{\cos^2 \frac{900}{7} (2 \cos \frac{900}{7} + 1)^2}{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}\\
&= \frac{4 \cos^4 \frac{900}{7} + 4 \cos^3 \frac{900}{7} + \cos^2 \frac{900}{7}}{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}
\end{align*}

Now, we can simplify this expression using the fact that $\cos \frac{900}{7} = \cos \left(\frac{1}{2} \cdot \frac{1800}{7}\right) = \pm \sqrt{\frac{1 + \cos \frac{1800}{7}}{2}} = \pm \sqrt{\frac{1 + 2 \cos^2 \frac{900}{7} - 1}{2}} = \pm \sqrt{\cos^2 \frac{900}{7}} = \pm \cos \frac{900}{7}$.

\begin{align*}
\cos^2 \angle GOM &= \frac{4 \cos^4 \frac{900}{7} + 4 \cos^3 \frac{900}{7} + \cos^2 \frac{900}{7}}{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}\\
&= \frac{\cos^2 \frac{900}{7} (4 \cos^2 \frac{900}{7} + 4 \cos \frac{900}{7} + 1)}{2 \cos^2 \frac{900}{7} + 2 \cos \frac{900}{7} + 1}\\
&= \boxed{\cos^2 \frac{900}{7}}
\end{align*}

The final answer is \boxed{\cos^2 \frac{900}{7}}.

\end{document}

