\section*{Solution}

We are given $\sin^2 \theta + \sin \theta = 1.$ We can solve for $\sin \theta$ by treating it as a quadratic equation. Let $x = \sin \theta.$ Then we have $x^2 + x = 1,$ or $x^2 + x - 1 = 0.$ We can solve for $x$ using the quadratic formula: $x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}.$ In this case, $a = 1,$ $b = 1,$ and $c = -1.$ Plugging these values into the quadratic formula, we get $x = \frac{-1 \pm \sqrt{1^2 - 4(1)(-1)}}{2(1)} = \frac{-1 \pm \sqrt{5}}{2}.$ Since $x = \sin \theta$ and $-1 \le \sin \theta \le 1,$ we must have $x = \frac{-1 + \sqrt{5}}{2}.$ Therefore, $\sin \theta = \frac{-1 + \sqrt{5}}{2}.$

Now, we can find $\cos^2 \theta$ using the identity $\sin^2 \theta + \cos^2 \theta = 1.$ We have $\cos^2 \theta = 1 - \sin^2 \theta = 1 - \left(\frac{-1 + \sqrt{5}}{2}\right)^2 = 1 - \frac{3 - \sqrt{5}}{2} = \frac{2 - 3 + \sqrt{5}}{2} = \frac{-1 + \sqrt{5}}{2}.$

Finally, we can find $\cos^4 \theta + \cos^2 \theta$ by substituting the value of $\cos^2 \theta$ that we found: $\cos^4 \theta + \cos^2 \theta = \left(\frac{-1 + \sqrt{5}}{2}\right)^2 + \frac{-1 + \sqrt{5}}{2} = \frac{3 - \sqrt{5}}{2} + \frac{-1 + \sqrt{5}}{2} = \frac{2}{2} = 1.$

\begin{equation*}
\boxed{1}
\end{equation*}

