To solve this problem, we need to use the formula for a rotation in the complex plane. A rotation of $\theta$ degrees counter-clockwise is given by $z' = z \cdot e^{i\theta}$. In this case, we have $z = \sqrt{2} - 5 \sqrt{2} i$ and $\theta = 135^\circ$. 

First, we need to convert $\theta$ to radians. There are $2\pi$ radians in a full circle, so $\theta = 135^\circ = \frac{135}{360} \cdot 2\pi = \frac{3\pi}{4}$ radians.

Now we can apply the rotation formula:
\begin{align*}
z' &= z \cdot e^{i\theta} \\
&= (\sqrt{2} - 5 \sqrt{2} i) \cdot e^{i\frac{3\pi}{4}} \\
&= (\sqrt{2} - 5 \sqrt{2} i) \cdot (\cos{\frac{3\pi}{4}} + i\sin{\frac{3\pi}{4}}) \\
&= (\sqrt{2} - 5 \sqrt{2} i) \cdot (-\frac{\sqrt{2}}{2} + i\frac{\sqrt{2}}{2}) \\
&= -\frac{\sqrt{2}}{2}(\sqrt{2} - 5 \sqrt{2} i) + i\frac{\sqrt{2}}{2}(\sqrt{2} - 5 \sqrt{2} i) \\
&= -1 + 5i + i - 5i^2 \\
&= -1 + 6i + 5 \\
&= 4 + 6i
\end{align*}

\boxed{4 + 6i}

