\newcommand{\vector}[1]{\mathbf{#1}}
\newcommand{\anglebetween}[2]{\angle(\vector{#1}, \vector{#2})}

We are given that $\anglebetween{a}{b} = 29^\circ$ and $\anglebetween{b}{a - b} = 84^\circ.$

We can use the fact that the sum of the angles in a triangle is $180^\circ$ to find the angle between $\vector{a}$ and $\vector{a} - \vector{b}.$

Let $\theta = \anglebetween{a}{a - b}.$ Then we have

\begin{align*}
\anglebetween{a}{b} + \anglebetween{b}{a - b} + \theta &= 180^\circ\\
\Rightarrow\qquad 29^\circ + 84^\circ + \theta &= 180^\circ\\
\Rightarrow\qquad \theta &= 180^\circ - 29^\circ - 84^\circ\\
\Rightarrow\qquad \theta &= \boxed{67^\circ}.
\end{align*}

