We want to find the smallest positive real number $t$ for which $\cos t = \cos t^{\circ}$. We know that $\cos t^{\circ} = \cos \frac{\pi t}{180}$. So, we want to find the smallest positive real number $t$ for which $\cos t = \cos \frac{\pi t}{180}$. 

We know that $\cos t = \cos \frac{\pi t}{180}$ when $t = \frac{\pi t}{180} + 2\pi k$ or $t = -\frac{\pi t}{180} + 2\pi k$, where $k$ is an integer.

Solving for $t$ in the first equation, we get $t = \frac{360k}{179} \pi$. Since we want the smallest positive real number $t$, we let $k = 1$ to get $t = \frac{360}{179} \pi$.

Solving for $t$ in the second equation, we get $t = \frac{360k}{181} \pi$. Since we want the smallest positive real number $t$, we let $k = 1$ to get $t = \frac{360}{181} \pi$.

Since $\frac{360}{179} \pi < \frac{360}{181} \pi$, the smallest positive real number $t$ for which $\cos t = \cos t^{\circ}$ is $\frac{360}{179} \pi$.

Now, we want to compute $\lfloor t\rfloor$, the greatest integer less than $t$. We have $\lfloor t\rfloor = \lfloor \frac{360}{179} \pi \rfloor$.

Since $\frac{360}{179} \pi \approx 6.283185307$, we have $\lfloor \frac{360}{179} \pi \rfloor = 6$.

\begin{equation*}
\boxed{6}
\end{equation*}

