\section*{$\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b})$ Maximum Value}

To find the maximum value of $\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b})$, we need to first find the cross product of $\mathbf{a}$ and $\mathbf{b}$.

\begin{align*}
\mathbf{a} \times \mathbf{b} &= \begin{pmatrix} a_1 \\ a_2 \\ a_3 \end{pmatrix} \times \begin{pmatrix} -1 \\ 4 \\ 6 \end{pmatrix} \\
&= \begin{pmatrix} a_2 \cdot 6 - a_3 \cdot 4 \\ a_3 \cdot (-1) - a_1 \cdot 6 \\ a_1 \cdot 4 - a_2 \cdot (-1) \end{pmatrix} \\
&= \begin{pmatrix} 6a_2 - 4a_3 \\ -a_3 - 6a_1 \\ 4a_1 + a_2 \end{pmatrix}
\end{align*}

Now, we can find the dot product of $\mathbf{c}$ and $\mathbf{a} \times \mathbf{b}$.

\begin{align*}
\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b}) &= \begin{pmatrix} 2 \\ -7 \\ -10 \end{pmatrix} \cdot \begin{pmatrix} 6a_2 - 4a_3 \\ -a_3 - 6a_1 \\ 4a_1 + a_2 \end{pmatrix} \\
&= 2(6a_2 - 4a_3) - 7(-a_3 - 6a_1) - 10(4a_1 + a_2) \\
&= 12a_2 - 8a_3 + 7a_3 + 42a_1 - 40a_1 - 10a_2 \\
&= 2a_2 - a_3 + 2a_1
\end{align*}

Since $\mathbf{a}$ is a unit vector, we know that $a_1^2 + a_2^2 + a_3^2 = 1$. To maximize $\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b})$, we can use the Cauchy-Schwarz inequality.

\begin{align*}
|\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b})| &\leq ||\mathbf{c}|| \cdot ||\mathbf{a} \times \mathbf{b}||
\end{align*}

Since $\mathbf{a}$ is a unit vector, $||\mathbf{a}|| = 1$. We can find $||\mathbf{c}||$.

\begin{align*}
||\mathbf{c}|| &= \sqrt{2^2 + (-7)^2 + (-10)^2} \\
&= \sqrt{4 + 49 + 100} \\
&= \sqrt{153}
\end{align*}

We can also find $||\mathbf{a} \times \mathbf{b}||$.

\begin{align*}
||\mathbf{a} \times \mathbf{b}|| &= \sqrt{(6a_2 - 4a_3)^2 + (-a_3 - 6a_1)^2 + (4a_1 + a_2)^2} \\
&= \sqrt{36a_2^2 - 48a_2a_3 + 16a_3^2 + a_3^2 + 12a_1a_3 + 36a_1^2 + 16a_1^2 + 8a_1a_2 + a_2^2} \\
&= \sqrt{37a_2^2 + 17a_3^2 + 52a_1^2 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3}
\end{align*}

Since $a_1^2 + a_2^2 + a_3^2 = 1$, we can substitute this into the expression for $||\mathbf{a} \times \mathbf{b}||$.

\begin{align*}
||\mathbf{a} \times \mathbf{b}|| &= \sqrt{37a_2^2 + 17a_3^2 + 52a_1^2 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3} \\
&= \sqrt{37a_2^2 + 17a_3^2 + 52(1 - a_2^2 - a_3^2) + 8a_1a_2 - 48a_2a_3 + 12a_1a_3} \\
&= \sqrt{37a_2^2 + 17a_3^2 + 52 - 52a_2^2 - 52a_3^2 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3} \\
&= \sqrt{-15a_2^2 - 35a_3^2 + 52 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3}
\end{align*}

To maximize $||\mathbf{a} \times \mathbf{b}||$, we can set the partial derivatives with respect to $a_1$, $a_2$, and $a_3$ equal to zero.

\begin{align*}
\frac{\partial ||\mathbf{a} \times \mathbf{b}||}{\partial a_1} &= \frac{8a_2 + 12a_3}{2\sqrt{-15a_2^2 - 35a_3^2 + 52 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3}} = 0 \\
\frac{\partial ||\mathbf{a} \times \mathbf{b}||}{\partial a_2} &= \frac{-30a_2 + 8a_1 - 48a_3}{2\sqrt{-15a_2^2 - 35a_3^2 + 52 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3}} = 0 \\
\frac{\partial ||\mathbf{a} \times \mathbf{b}||}{\partial a_3} &= \frac{-70a_3 - 48a_2 + 12a_1}{2\sqrt{-15a_2^2 - 35a_3^2 + 52 + 8a_1a_2 - 48a_2a_3 + 12a_1a_3}} = 0
\end{align*}

Solving these equations, we get $a_1 = \frac{2}{\sqrt{17}}$, $a_2 = \frac{4}{\sqrt{17}}$, and $a_3 = \frac{1}{\sqrt{17}}$.

Now, we can find the maximum value of $\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b})$.

\begin{align*}
\mathbf{c} \cdot (\mathbf{a} \times \mathbf{b}) &= 2a_2 - a_3 + 2a_1 \\
&= 2\left(\frac{4}{\sqrt{17}}\right) - \frac{1}{\sqrt{17}} + 2\left(\frac{2}{\sqrt{17}}\right) \\
&= \frac{8}{\sqrt{17}} - \frac{1}{\sqrt{17}} + \frac{4}{\sqrt{17}} \\
&= \frac{11}{\sqrt{17}} \\
&= \boxed{\sqrt{17}}
\end{align*}

