We are given that $\mathbf{a} + \mathbf{b}$ and $\mathbf{b}$ are orthogonal, and $\mathbf{a} + 2 \mathbf{b}$ and $\mathbf{a}$ are orthogonal. This means that $(\mathbf{a} + \mathbf{b}) \cdot \mathbf{b} = 0$ and $(\mathbf{a} + 2 \mathbf{b}) \cdot \mathbf{a} = 0$.

\begin{align*}
(\mathbf{a} + \mathbf{b}) \cdot \mathbf{b} &= 0 \\
\mathbf{a} \cdot \mathbf{b} + \mathbf{b} \cdot \mathbf{b} &= 0 \\
\mathbf{a} \cdot \mathbf{b} &= -\|\mathbf{b}\|^2 \quad (1)
\end{align*}

\begin{align*}
(\mathbf{a} + 2 \mathbf{b}) \cdot \mathbf{a} &= 0 \\
\mathbf{a} \cdot \mathbf{a} + 2 \mathbf{b} \cdot \mathbf{a} &= 0 \\
\|\mathbf{a}\|^2 &= -2 \mathbf{b} \cdot \mathbf{a} \\
\|\mathbf{a}\|^2 &= 2 \|\mathbf{b}\|^2 \quad \text{using (1)}
\end{align*}

\begin{align*}
\frac{\|\mathbf{a}\|^2}{\|\mathbf{b}\|^2} &= 2 \\
\frac{\|\mathbf{a}\|}{\|\mathbf{b}\|} &= \sqrt{2} \\
\end{align*}

\begin{equation*}
\boxed{\sqrt{2}}
\end{equation*}

